import React, { Component } from 'react';
import './navstyle.css';
import Img1 from './github.png';
import Img2 from './linkedin.png';

class Nav extends Component {

  render(){
   return (
      <div className='nav'>
      <a href="#"><img src={Img1} style={{zIndex:5,width:100,height:20,position:'absolute',left:700,top:-100}} /> </a>
      <a href="#"><img src={Img2} style={{width:200,height:20,position:'absolute',left:800,top:10}} /> </a>
      </div>
    );
  }
}

export default Nav;
